import React,{useState} from 'react'

const RegisterComponent = () => {
     const [first, setfirst] = useState('')
     const [last, setlast] = useState('')
     const [email, setemail] = useState('')
     const [password, setpassword] = useState('')
     const [confirmPassword, setconfirmpassword] = useState('')

     const saveEmployee=(e) =>{
        e.preventDefault();
        const user= {first, last, email, password, confirmPassword}
        console.log(user);
     }

    return (
        <form >
            <h3>Sign Up</h3>

            <div className="form-group" >
                <label>First Name</label>

                <input type="text" value={first} className="form-control" placeholder="First Name"
                    onChange={e => setfirst(e.target.value)}/>
            </div>

            <div className="form-group" >
                <label>Last Name</label>

                <input type="text"  value={last} className="form-control" placeholder="Last Name"
                onChange={e => setlast(e.target.value)}/>
            </div>

            <div className="form-group" >
                <label>Email</label>

                <input type="email"  value={email}className="form-control" placeholder="Email"
                onChange={e => setemail(e.target.value)}/>
            </div>

            <div className="form-group" >
                <label>Password</label>

                <input type="password"  value={password} className="form-control" placeholder="Password"
                onChange={e => setpassword(e.target.value)}/>
            </div>

            <div className="form-group" >
                <label>Confirm Password</label>

                <input type="password"  value={confirmPassword} className="form-control" placeholder="Confirm Password"
                onChange={e => setconfirmpassword(e.target.value)}/>
            </div>
            <button className="btn btn-primary btn-block" onClick={(e)=> saveEmployee(e)}>Sign Up</button>
        </form>
    )
}


export default RegisterComponent
